INSERT INTO `movie` VALUES (6,'Titanic',194,'eng','1997-12-19','USA','A seventeen-year-old aristocrat falls in love with a kind but poor artist aboard the luxurious, ill-fated R.M.S. Titanic.','titnk.jpg'),(12,'Finding Nemo',120,'en','2003-05-30',NULL,'Nemo, an adventurous young clownfish, is unexpectedly taken from his Great Barrier Reef home to a dentist\'s office aquarium. It\'s up to his worrisome father Marlin and a friendly but forgetful fish Dory to bring Nemo home -- meeting vegetarian sharks',NULL),(155,'The Dark Knight',120,'en','2008-07-16',NULL,'Batman raises the stakes in his war on crime. With the help of Lt. Jim Gordon and District Attorney Harvey Dent, Batman sets out to dismantle the remaining criminal organizations that plague the streets. The partnership proves to be effective, but th',NULL),(238,'The Godfather',120,'en','1972-03-14',NULL,'Spanning the years 1945 to 1955, a chronicle of the fictional Italian-American Corleone crime family. When organized crime family patriarch, Vito Corleone barely survives an attempt on his life, his youngest son, Michael steps in to take care of the ',NULL),(278,'The Shawshank Redemption',120,'en','1994-09-23',NULL,'Framed in the 1940s for the double murder of his wife and her lover, upstanding banker Andy Dufresne begins a new life at the Shawshank prison, where he puts his accounting skills to work for an amoral warden. During his long stretch in prison, Dufre',NULL),(329,'Jurassic Park',120,'en','1993-06-11',NULL,'A wealthy entrepreneur secretly creates a theme park featuring living dinosaurs drawn from prehistoric DNA. Before opening day, he invites a team of experts and his two eager grandchildren to experience the park and help calm anxious investors. Howev',NULL),(675,'Harry Potter and the Order of the Phoenix',120,'en','2007-06-28',NULL,'Returning for his fifth year of study at Hogwarts, Harry is stunned to find that his warnings about the return of Lord Voldemort have been ignored. Left with no choice, Harry takes matters into his own hands, training a small group of students – dubb',NULL),(10681,'WALL·E',120,'en','2008-06-22',NULL,'WALL·E is the last robot left on an Earth that has been overrun with garbage and all humans have fled to outer space. For 700 years he has continued to try and clean up the mess, but has developed some rather interesting human-like qualities. When a ',NULL),(19995,'Avatar',120,'en','2009-12-10',NULL,'In the 22nd century, a paraplegic Marine is dispatched to the moon Pandora on a unique mission, but becomes torn between following orders and protecting an alien civilization.',NULL),(44214,'Black Swan',120,'en','2010-12-02',NULL,'A ballet dancer wins the lead in \"Swan Lake\" and is perfect for the role of the delicate White Swan - Princess Odette - but slowly loses her mind as she becomes more and more like Odile, the Black Swan.',NULL),(49018,'Insidious',120,'en','2010-09-13',NULL,'A family discovers that dark spirits have invaded their home after their son inexplicably falls into an endless sleep. When they reach out to a professional for help, they learn things are a lot more personal than they thought.',NULL),(58595,'Snow White and the Huntsman',120,'en','2012-05-30',NULL,'After the Evil Queen marries the King, she performs a violent coup in which the King is murdered and his daughter, Snow White, is taken captive. Almost a decade later, a grown Snow White is still in the clutches of the Queen. In order to obtain immor',NULL),(87101,'Terminator Genisys',120,'en','2015-06-23',NULL,'The year is 2029. John Connor, leader of the resistance continues the war against the machines. At the Los Angeles offensive, John\'s fears of the unknown future begin to emerge when TECOM spies reveal a new plot by SkyNet that will attack him from bo',NULL),(109445,'Frozen',120,'en','2013-11-27',NULL,'Young princess Anna of Arendelle dreams about finding true love at her sister Elsa’s coronation. Fate takes her on a dangerous journey in an attempt to end the eternal winter that has fallen over the kingdom. She\'s accompanied by ice delivery man Kri',NULL),(141052,'Justice League',120,'en','2017-11-15',NULL,'Fueled by his restored faith in humanity and inspired by Superman\'s selfless act, Bruce Wayne and Diana Prince assemble a team of metahumans consisting of Barry Allen, Arthur Curry, and Victor Stone to face the catastrophic threat of Steppenwolf and ',NULL),(250546,'Annabelle',120,'en','2014-10-02',NULL,'John Form has found the perfect gift for his expectant wife, Mia - a beautiful, rare vintage doll in a pure white wedding dress. But Mia\'s delight with Annabelle doesn\'t last long. On one horrific night, their home is invaded by members of a satanic ',NULL),(281338,'War for the Planet of the Apes',120,'en','2017-07-11',NULL,'Caesar and his apes are forced into a deadly conflict with an army of humans led by a ruthless Colonel. After the apes suffer unimaginable losses, Caesar wrestles with his darker instincts and begins his own mythic quest to avenge his kind. As the jo',NULL),(284053,'Thor: Ragnarok',120,'en','2017-10-25',NULL,'Thor is imprisoned on the other side of the universe and finds himself in a race against time to get back to Asgard to stop Ragnarok, the destruction of his homeworld and the end of Asgardian civilization, at the hands of an all-powerful new threat, ',NULL),(286217,'The Martian',120,'en','2015-09-30',NULL,'During a manned mission to Mars, Astronaut Mark Watney is presumed dead after a fierce storm and left behind by his crew. But Watney has survived and finds himself stranded and alone on the hostile planet. With only meager supplies, he must draw upon',NULL),(297761,'Suicide Squad',120,'en','2016-08-02',NULL,'From DC Comics comes the Suicide Squad, an antihero team of incarcerated supervillains who act as deniable assets for the United States government, undertaking high-risk black ops missions in exchange for commuted prison sentences.',NULL),(297762,'Wonder Woman',120,'en','2017-05-30',NULL,'An Amazon princess comes to the world of Man to become the greatest of the female superheroes.',NULL),(346364,'It',120,'en','2017-09-05',NULL,'In a small town in Maine, seven children known as The Losers Club come face to face with life problems, bullies and a monster that takes the shape of a clown called Pennywise.',NULL),(432527,'Padmavati',120,'hi','2017-12-01',NULL,'The story of Alauddin Khilji, the second ruler of the Khilji dynasty, and his obsessive love for the queen of Mewar, Padmavati, renowned for her beauty, intellect and courage.',NULL);
