INSERT INTO `movie_log` VALUES (440021,'Happy Death Day',120,'en','2017-10-12',NULL,'A college student relives the day of her murder over and over again as she tries to discover her killer\'s identity.','01:32:52'),(459725,'Velipadinte Pusthakam',120,'ml','2017-08-31',NULL,'Professor Mathew Idikkula who reformed the atmosphere of a college by developing a healthy relationship between teachers and students. The film reflects the goodness of the youth and the impact the students can have.','03:06:47'),(15860,'Dragon Tiger Gate',120,'cn','2006-07-27',NULL,'Dragon Tiger Gate is a 2006 Hong Kong martial arts-action film directed by Wilson Yip and featuring fight choreography by Donnie Yen, who also stars in the film. The film is based on the popular Hong Kong manhua, Oriental Heroes, which bears the same','03:10:40'),(409255,'Premam',120,'te','2016-09-09',NULL,'Vikram falls in love with three women at different stages of his life which changes him as a person until he finally meets the love of his life.','11:38:22');
